import React from 'react';
import { Jumbotron, Container } from 'react-bootstrap';


function Jumbo() {
    return (
        <div className='jumbotron-main'>
            <Jumbotron>
                <Container>
                    <h1>GRETCHEN KRAMMES</h1>
                    <p>Hello there!</p>
                </Container>
            </Jumbotron>
        </div>
    );
  }

  export default Jumbo;
